import React, { useState } from 'react';
import { BrowserRouter as Router, Routes, Route, Link } from 'react-router-dom';
import './App.css';
import { initializeApp } from 'firebase/app'; // Importa initializeApp desde 'firebase/app'
import { getAuth } from 'firebase/auth'; // Importa getAuth desde 'firebase/auth'
import Login from './Login';
import Tienda from './Tienda';
import ShoppingCart from './ShoppingCart';
import HomeCookedMeals from './HomeCookedMeals';
import PetWeddings from './PetWeddings';
import Healthcare from './Healthcare';
import PetNames from './PetNames';

const firebaseConfig = {
  apiKey: "AIzaSyA59qbASepDAJRrIZL1yePlQ4JPe-LYhHI",
  authDomain: "TU_DOMINIO.firebaseapp.com",
  projectId: "TU_ID_DE_PROYECTO",
  storageBucket: "TU_STORAGE_BUCKET",
  messagingSenderId: "TU_SENDER_ID",
  appId: "TU_APP_ID",
  measurementId: "TU_MEASUREMENT_ID"
};


const app = firebase.initializeApp(firebaseConfig);

function App() {
  const [loggedIn, setLoggedIn] = useState(false);

  const handleLogin = () => {
    console.log("Handle login called");
    setLoggedIn(true);
  };

  const handleGoogleLogin = async () => {
    const provider = new firebase.auth.GoogleAuthProvider();
    try {
      await firebase.auth().signInWithPopup(provider);
      setLoggedIn(true);
    } catch (error) {
      console.error('Error al iniciar sesión con Google:', error);
    }
  };

  const handleFacebookLogin = async () => {
    const provider = new firebase.auth.FacebookAuthProvider();
    try {
      await firebase.auth().signInWithPopup(provider);
      setLoggedIn(true);
    } catch (error) {
      console.error('Error al iniciar sesión con Facebook:', error);
    }
  };

  const handleCreateAccount = () => {
    // Lógica para redirigir a la página de registro o ejecutar la creación de cuenta
    console.log("Create account clicked");
  };

  console.log("Logged in state:", loggedIn);

  return (
    <Router>
      <div className="App">
        {!loggedIn && <Login onLogin={handleLogin} onGoogleLogin={handleGoogleLogin} onFacebookLogin={handleFacebookLogin} onCreateAccount={handleCreateAccount} />}
        {/* Aquí puedes agregar más rutas para otras páginas de tu aplicación */}
      </div>
    </Router>
  );
}

export default App;
